import React from 'react';

const EmployeeList = ({ employees }) => {
  return (
    <div>
      <h1>Employee list:</h1>
      <ul>
        {employees.map((employee) => (
          <li key={employee.id}>
            Id: {employee.id} | Name: {employee.name} | Job: {employee.job} | WorkstationNo: {employee.workstationNo}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default EmployeeList;












